function item(filteredSearch) {
  return {
    "device": filteredSearch['device']['results'], 
    "user": filteredSearch['user']['results'], 
    "did": filteredSearch['did']['results']
  }
}

function displayStyle(style) {
  return {
    "device": style.searchTypeDeviceStyle, 
    "user": style.searchTypeUserStyle, 
    "did": style.searchTypeDidStyle
  }
}

export {
  item,
  displayStyle
}
